function DropdownMenu() {
    const [activeMenu,setActiveMenu] = useState('main')
    const [menuHeight,setMenuHeight] = useState(null)
    const dropdownRef = useRef(null);

    useEffect(() => {
      setMenuHeight(dropdownRef.current?.firstChild.offsetHeight)
    }, [])


    function calcHeight(el) {
      const height = el.offsetHeight;
      setMenuHeight(height);
    }

    function DropdownItem(props) {
      const onClick = (event) => {
        event.preventDefault();
        if (props.goToMenu) {
          setActiveMenu(props.goToMenu);
        }
        if (props.onClick) {
          props.onClick();
        }
      };

      return (
        <a href="#" className="menu-item" onClick={onClick}>
          <span className="icon-button">{props.leftIcon}</span>
          {props.children}
          <span className="icon-right">{props.rightIcon}</span>
        </a>
      );
    }



    return (
      <div className="dropdown" style={{ height: menuHeight }} ref={dropdownRef}>

        <CSSTransition
          in={activeMenu === 'main'}
          timeout={500}
          classNames="menu-primary"
          unmountOnExit
          onEnter={calcHeight}>
          <div className="menu">
            <DropdownItem 
              rightIcon={<DeleteAll/>}
              onClick={removeAllTasks}>
              Elimina Tutto
              </DropdownItem>
            <DropdownItem
              rightIcon={<ExpoButton/>}
              onClick={handleExport}>
              Esporta JSON
            </DropdownItem>
            <DropdownItem
              rightIcon={<FilterButton/>}
              goToMenu="filtri">
              Filtra
            </DropdownItem>
            <DropdownItem
              rightIcon={<Settings/>}
              goToMenu="settings">
              Impostazioni
            </DropdownItem>
            <DropdownItem
              rightIcon={<Logout/>}
              onClick={handleLogout}>
              Cambia Account
            </DropdownItem>

          </div>
        </CSSTransition>

        <CSSTransition
        in={activeMenu === 'filtri'}
        timeout={500}
        classNames="menu-secondary"
        unmountOnExit
        onEnter={calcHeight}>
        <div className="menu">
          <DropdownItem
          rightIcon={<AtoZ/>}
          onClick={handleSorted}
          > 
          Da A a Z
          </DropdownItem>
          <DropdownItem
          rightIcon={<ZtoA/>}
          onClick={handleSortedDesc}
          > 
          Da Z a A
          </DropdownItem>
          <DropdownItem
          rightIcon={<Completed/>}
          onClick={handleSortedDone}
          > Completate
          </DropdownItem>
          <DropdownItem
          rightIcon={<NotCompleted/>}
          onClick={handleNotDone}
          > 
          Da completare
          </DropdownItem>
          <DropdownItem 
          goToMenu="main"
          rightIcon={<GoBack/>}>
          Torna indietro
          </DropdownItem>

        </div>
      </CSSTransition>

      <CSSTransition
        in={activeMenu === 'settings'}
        timeout={500}
        classNames="menu-secondary"
        unmountOnExit
        onEnter={calcHeight}>
        <div className="menu">
          <DropdownItem
          rightIcon={<DeleteUser/>}
          onClick={HandleDeleteAccount}> 
          Elimina account
          </DropdownItem>
          <DropdownItem 
          goToMenu="main"
          rightIcon={<GoBack/>}>
          Torna indietro
          </DropdownItem>
        </div>
      </CSSTransition>

      </div>
    );
  }

  export default DropdownMenu
